import React from 'react';

const Portfolioitem = props => {
	return (
		<div className="portfolio-item" style={{ border: '1px solid blue' }}>
			<h1>{props.name}</h1>
			<h2>{props.backgroundImageURL}</h2>
		</div>
	);
};

export default Portfolioitem;
